import React from "react";
import './list.css'

class List extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            pos: 0,
            races: [
                'Дварф',
                'Эльф',
                'Полурослик',
                'Человек',
                'Драконорожденный',
                'Гном',
                'Полуэльф',
                'Полуорк',
                'Тифлинг',
            ],
            colors: [
                'goldenrod',
                'forestgreen',
                'saddlebrown',
                'grey',

            ]
        }
    }
    render() {
        return (
            <div className="race-div">
                <ul className="race-list-ul">
                    {this.state.races.map(
                        (text)=>(
                            <li className="race-list-li">{text}</li>
                        )
                    )}
                </ul>
            </div>
        );
    }
}

export default List
